void encryptFile(string filePath, string password, string fileContents)
{
   // Open the file that will be encrypted
   ofstream outFile;
   outFile.open(filePath.c_str());

   // Write the contents of the file to be encrypted to the file
   outFile << fileContents;

   // Close the file
   outFile.close();

   // This is the command that will be used to encrypt the file
   // The "/E" flag encrypts the file
   // The "/C" flag specifies that the file will be encrypted with a password
   // The "/P" flag specifies the password that will be used to encrypt the file
   string encryptCommand = "cipher /E /C /P " + password + " " + filePath;

   // Execute the command
   system(encryptCommand.c_str());
}

string decryptFile(string filePath, string password)
{
   // This is the command that will be used to decrypt the file
   // The "/D" flag decrypts the file
   // The "/C" flag specifies that the file will be decrypted with a password
   // The "/P" flag specifies the password that will be used to decrypt the file
   string decryptCommand = "cipher /D /C /P " + password + " " + filePath;

   // Execute the command
   system(decryptCommand.c_str());

   // Open the file that was just decrypted
   ifstream inFile;
   inFile.open(filePath.c_str());

   // Read the contents of the decrypted file into a string
   string fileContents;
   inFile >> fileContents;

   // Close the file
   inFile.close();

   // Return the contents of the decrypted file
   return fileContents;
}

