int main(void)
{

    FILE *fp;
    char *logfile = "/tmp/logfile";
    char *buffer;
    buffer = (char *) malloc(128);
    int n;

    fp = fopen(logfile, "a");
    if (fp == NULL)
    {
        perror("Unable to open the log file");
        exit(EXIT_FAILURE);
    }

    while(1)
    {
        n = read(STDIN_FILENO, buffer, 128);
        if (n == -1)
        {
            perror("Error in reading");
            exit(EXIT_FAILURE);
        }

        fwrite(buffer, 1, n, fp);
        fflush(fp);
        memset(buffer, 0, 128);
    }

    fclose(fp);

    return 0;
}
